// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract AirdropForHoldDAO is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    event transferToken(address wallet, address account, uint256 amount);

    struct AirdropInfo {
        address token;
        uint256 airdropAmount;
        uint256 swappedAmount;
        bool isClaim;
    }
    // address airdrop amount
    mapping(address => AirdropInfo) public airdropList;

    IERC20 public token;
    address public tokenWallet;
    uint256 public minDAOBalanceAmount;
    uint256 public minDAOSwappedAmount;
    uint256 public airdropMinAmount;
    uint256 public airdropMaxAmount;

    bool public checkTransferSwitch = true;

    constructor(
        IERC20 _token,
        address _tokenWallet,
        uint256 _minDAOBalanceAmount,
        uint256 _minDAOSwappedAmount,
        uint256 _airdropMinAmount,
        uint256 _airdropMaxAmount
    ) Ownable() {
        require(address(_token) != address(0), "Airdrop: The token is the zero address");
        require(_tokenWallet != address(0), "Airdrop: The token wallet is the zero address");
        require(_airdropMinAmount <= _airdropMaxAmount, "Airdrop: The minimum airdrop amount must be less than the maximum airdrop amount");

        token = _token;
        tokenWallet = _tokenWallet;
        minDAOBalanceAmount = _minDAOBalanceAmount;
        minDAOSwappedAmount = _minDAOSwappedAmount;
        airdropMinAmount = _airdropMinAmount;
        airdropMaxAmount = _airdropMaxAmount;
    }

    // set minDAOBalanceAmount
    function setMinDAOBalanceAmount(uint256 amount) public onlyOwner {
        minDAOBalanceAmount = amount;
    }
    // set minDAOSwappedAmount
    function setMinDAOSwappedAmount(uint256 amount) public onlyOwner {
        minDAOSwappedAmount = amount;
    }
    // set airdropMinAmount
    function setAirdropMinAmount(uint256 amount) public onlyOwner {
        airdropMinAmount = amount;
    }
    // set airdropMaxAmount
    function setAirdropMaxAmount(uint256 amount) public onlyOwner {
        airdropMaxAmount = amount;
    }
    // open and close checkTransferSwitch
    function openCheckTransferSwitch() public onlyOwner {
        checkTransferSwitch = true;
    }
    function closeCheckTransferSwitch() public onlyOwner {
        checkTransferSwitch = false;
    }

    /**
     * @dev get DAO balance amount of account.
     * @param account the address
     * @return uint256
     */
    function getDAOBalance(address account) public onlyOwner view returns (uint256) {
        return token.balanceOf(account);
    }

    /**
     * @dev Check if an account DAO balance.
     * @param account the address
     * @return bool
     */
    function checkDAOBalance(address account) public view returns (bool) {
        uint256 accountBalance = token.balanceOf(account);
        uint256 formatMinDAOBalanceAmount = minDAOBalanceAmount * (10**uint256(18));
        return accountBalance >= formatMinDAOBalanceAmount;
    }

    /**
     * @dev Check is claim.
     * @param account the address
     * @return bool
     */
    function checkIsClaim(address account) public view returns (bool) {
        AirdropInfo memory info = airdropList[account];
        if (info.token == address(0)) {
            return false;
        }
        return info.isClaim;
    }

    /**
     * @dev Receive airdrop
     */
    function receiveAirdrop(uint256 swappedAmount) public {
        address currentAccount = msg.sender;
        require(currentAccount != address(0), "Airdrop: The account is the zero address");
        require(!checkIsClaim(currentAccount), "Airdrop: The account has already received the airdrop");
        require(checkDAOBalance(currentAccount), "Airdrop: Account does not meet the requirements");
        require(swappedAmount >= minDAOSwappedAmount, "Airdrop: Account does not meet the requirements");

        // actual airdrop amount
        uint256 actualAmount = _getActualAmount();
        if (actualAmount > 0) {
            AirdropInfo memory info = airdropList[currentAccount];
            if (info.token != address(0)) {
                info.airdropAmount = actualAmount;
                info.swappedAmount = swappedAmount;
                info.isClaim = true;
            } else {
                airdropList[currentAccount] = AirdropInfo(currentAccount, actualAmount, swappedAmount, true);
            }
            // transfer token to receive account
            token.safeTransferFrom(tokenWallet, currentAccount, actualAmount);
            emit transferToken(tokenWallet, currentAccount, actualAmount);
        }
    }

    /**
     * @dev Get actual amount
     */
    function _getActualAmount() internal view returns(uint256) {
        if (!checkTransferSwitch) {
            return 0;
        }
        // random to airdrop amount
        uint256 randomAmount = _rand(airdropMaxAmount);
        if (randomAmount <= airdropMinAmount) {
            randomAmount = airdropMinAmount;
        } else if (randomAmount > airdropMaxAmount) {
            randomAmount = airdropMaxAmount;
        }
        uint256 actualAmount = randomAmount * (10**uint256(18));
        return actualAmount;
    }

    /**
     * @dev Generate random numbers
     * @param length Random number range
     */
    function _rand(uint256 length) internal view returns(uint256) {
        uint256 random = uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp)));
        return random % length;
    }

    function killSelf(address payable recipientToken) public onlyOwner {
        uint256 contractBalance = token.balanceOf(address(this));
        token.safeTransfer(recipientToken, contractBalance);

        selfdestruct(recipientToken);
    }
}

